import './App.css';
import { useState, useEffect } from 'react';
import React from 'react';
import LoginForm from './components/LoginForm'
import Home from './components/Home'
import Editar from './components/Editar'
import RegistrationForm from './components/Registrar'
import AdminTabla from './components/Ver-Admin'
import RegistrationAdmin from './components/Registrar-Admin'
import CrearTorneo from './components/Crear-Torneo'
import VerParticipantes from './components/Ver-Participantes'
import VerTorneos from './components/Ver-Torneos'
import BuscarTorneo from './components/Buscar-Torneo'
import Home_Admin from './components/Home-Admin';
import Home_Super from './components/Home-Super';
import BuscarAdmin from './components/Buscar-Admin';
import RegistrarTorneo from './components/Registrar-Torneo';
import VerTorneosAdmin from './components/Ver-Torneos-Admin';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import EditarTorneo from './components/EditarTorneo';
import EliminarTorneo from './components/EliminarTorneo';
import EliminarAdmin from './components/EliminarAdmin';

function App() {

  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Verificar si hay un token almacenado en el localStorage al cargar la página
    const token = localStorage.getItem('authToken');
    if (token) {
      // Puedes verificar la validez del token aquí si es necesario
      setIsAuthenticated(true);
    }
  }, []);

  return (
    <Router>
      <Routes>

      {/* Iniciar sesión */}
      <Route
          path="/"
          element={<LoginForm onAuthentication={setIsAuthenticated} />}
        />

      {/* Casos de uso de super administradores */}
      <Route
          path="/home-super"
          element={localStorage.getItem('authToken') == 'super' ? <Home_Super/> : <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/ver-participante-admin"
          element={localStorage.getItem('authToken') == 'super' ? <VerParticipantes/>: <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/ver-torneo-admin"
          element={localStorage.getItem('authToken') == 'super' ? <VerTorneosAdmin/>: <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/ver-admin"
          element={localStorage.getItem('authToken') == 'super' ? <AdminTabla/> : <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/registrar-admin"
          element={localStorage.getItem('authToken') == 'super' ? <RegistrationAdmin/> : <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/eliminar-admin"
          element={localStorage.getItem('authToken') == 'super' ? <EliminarAdmin/> : <p>Debes iniciar sesión</p>}
        />


      {/* Casos de uso de administradores */}
      <Route
          path="/home-admin"
          element={localStorage.getItem('authToken') == 'admin' ? <Home_Admin/> : <p>Debes iniciar sesión</p>}
        />

        <Route
          path="/crear-torneo"
          element={localStorage.getItem('authToken') == 'admin' ?  <CrearTorneo/> : <p>Debes iniciar sesión</p>}
        />

        <Route
          path="/ver-torneo"
          element={localStorage.getItem('authToken') == 'admin' ? <VerTorneos/> : <p>Debes iniciar sesión</p>}
        />

        <Route
          path="/editar-torneo"
          element={localStorage.getItem('authToken') == 'admin' ? <EditarTorneo/> : <p>Debes iniciar sesión</p>}
        />

      <Route
          path="/eliminar-torneo"
          element={localStorage.getItem('authToken') == 'admin' ? <EliminarTorneo/> : <p>Debes iniciar sesión</p>}
        />


      {/* Casos de uso de participantes */}

      <Route
          path="/home-participante"
          element={!isNaN(localStorage.getItem('authToken')) ? (<Home_Super />) : (<p>Debes iniciar sesión</p>)}
        />

        <Route
          path="/registrar"
          element={<RegistrationForm onAuthentication={setIsAuthenticated} />}
        />

        <Route
          path="/registrar-torneo"
          element={<RegistrarTorneo/>}
        />

      </Routes>
    </Router>
  );
}

export default App;
